import React, { useState, useEffect } from 'react';
import './App.css';
import { Button,TableRow,TableCell } from '@mui/material';

import Avatar from '@mui/material/Avatar';

import CssBaseline from '@mui/material/CssBaseline';
import TextField from '@mui/material/TextField';
import FormControlLabel from '@mui/material/FormControlLabel';
import Checkbox from '@mui/material/Checkbox';
import Link from '@mui/material/Link';
import Grid from '@mui/material/Grid';
import Box from '@mui/material/Box';
import LockOutlinedIcon from '@mui/icons-material/LockOutlined';
import Typography from '@mui/material/Typography';
import Container from '@mui/material/Container';
import { createTheme, ThemeProvider } from '@mui/material/styles';
function Copyright(props) {
    return (
      <Typography variant="body2" color="text.secondary" align="center" {...props}>
        {'Copyright © '}
        <Link color="inherit" href="https://mui.com/">
          Your Website
        </Link>{' '}
        {new Date().getFullYear()}
        {'.'}
      </Typography>
    );
  }

  // TODO remove, this demo shouldn't need to reset the theme.

  const defaultTheme = createTheme();



const datatest = [{"id":1,"description":"1.ก่อนวันเลือกตั้ง (Before Election Date)"},{"id":2,"description":"2. ณ วันเลือกตั้ง (On Election Date)"},{"id":3,"description":"3. หลังจากวันเลือกตั้ง (After Election Date)"},{"id":4,"description":"4. อื่นๆ (โปรดระบุ)"}]
var count =2;
function Table1() {
    const [data1, setData] = useState([]);

    useEffect(() => {

        async function getJSON() {

              const response = await fetch("http://localhost:3333/layer1", {
                method: "GET", // or 'PUT'


              });



              const data = await response.json();




            setData(data);

          }


          getJSON();
      }, [])
      console.log(data1);

      function gotolayer(params,parrams1){
        count++;
        async function getJSON() {

            const response = await fetch("http://localhost:3333/layer"+params+parrams1, {
              method: "GET", // or 'PUT'


            });



            const data = await response.json();




          setData(data);

        }


        getJSON();
      };
  return (


<ThemeProvider theme={defaultTheme}>
      <Container component="main" maxWidth="xs">
        <CssBaseline />
        <Box
          sx={{
            marginTop: 8,
            display: 'flex',
            flexDirection: 'column',
            alignItems: 'center',
          }}
        >
        {data1.map((row) => (
                                  <TableRow
                                    hover
                                    tabIndex={-1}
                                    key={row.id}
                                  >
                                    <TableCell align="center">

                                    </TableCell>
                                    <TableCell>
                                    <Button onClick={() =>gotolayer(count,row.id)}>{row.description}</Button>
                                    </TableCell>

                                  </TableRow>
                                ))}


        </Box>
        <Copyright sx={{ mt: 8, mb: 4 }} />
      </Container>
    </ThemeProvider>



  );
}

export default Table1;
